import React from 'react';
import form from './MealInput.module.css'
import Input from '../../UI/Input';

function MealInput(props) {
  return (
        <>
        <form className={ form.form}>

         <Input label="amount" input={{
            id:"amount",
            type:"number",
            min:"1",
            max:"5",
            step:"1",
            DefaultValue:"1",

         }}/>
            <button> + add</button>
        </form>
        </>
  )
}

export default MealInput
